webpackJsonp([49213220826387],{656:function(e,t){e.exports={data:{markdownRemark:{html:"<p>A csapat 2015-ben alakult a LeVisonta névre keresztelt 24 órás robogóversenyen való részvétel céljából. Már az első versenyen sikereket ért el a csapat, egy Yamaha Joggal a 14. helyezést érték el.</p>\n<p>2016-ban újult erővel és új géppel – Zip SP1 – álltak rajthoz. Sem a kemény verseny, sem az időnként zord időjárás nem jelentett problémát: 24 óra elteltével a csapat az előkelő 9. helyen ért célba.</p>\n<p>2017-ben a változatosság kedvéért ismét újabb robogóval álltak rajthoz: P.Barbi (Piaggo Liberty) szenzációs versenyt futva 2. helyen végzett, miután több csapatot is kizártak a verseny utáni átvizsgálás során.</p>\n<p>A robogóversenyek sikerei után a csapat egy újabb, és egyben sokkal nagyobb kihívást keresett magának: hosszas keresgélés után a MotoStudent versenyre esett a tagok választása. Véleményük szerint a motor különböző részeinek tervezése, legyártása és tesztelése óriási kihívás, kaland, valamint fejlődési lehetőség.</p>\n<p>A csapat fontosnak tartja, hogy a versenyen való helytállással ne csak a saját eredményeinek sorát gyarapítsa, de ezzel méltó módon képviselje a Műegyetemet – most már nemzetközi szinteken.</p>",excerpt:"A csapat 2015-ben alakult a LeVisonta névre keresztelt 24 órás robogóversenyen való részvétel céljából. Már az első versenyen sikereket ért…",frontmatter:{title:"BME MotoRacing Team",excerpt:"A csapat 2015-ben alakult a LeVisonta névre keresztelt 24 órás robogóversenyen való részvétel céljából. Már az első versenyen sikereket ért el a csapat, egy Yamaha Joggal a 14. helyezést érték el.",thumbnail:null}}},pathContext:{slug:"/teams/motoracing/"}}}});
